import React from "react";

function Customer({ customer }) {
    return (
        <div className="card" style={{ width: '18rem' }}>
            <div className="card-body">
            <h5 className="card-title">Customer Id : {customer.CustID}</h5>
                <h5 className="card-title">Name : {customer.CustName}</h5>
                <h6 className="card-subtitle mb-2 text-muted">Mobile No : {customer.CustMobNo}</h6>
                <p className="card-text">Address : {customer.CustAddress}</p>
                <button type="button" className="btn btn-outline-warning">Update</button>
                <button type="button" className="btn btn-outline-danger ml-3">Delete</button>
            </div>
        </div>
    )
}

export default Customer
